import React from "react";
import { Projects } from "../components/Projects";

function ProjectsPage() {
  const customFunction = (project) => {};

  const iterateProjects = () => {
    // Object.values(Projects).forEach((project) => console.log(project));
  };

  return <div className="project-gallery">{iterateProjects()}</div>;
}

class ProjectPage extends React.Component {
  iterateProjects = () => {
    Object.values(Projects).forEach((project) => console.log(project));
  };

  componentDidMount() {
    console.log("Project page loaded");
  }

  componentDidUpdate() {
    console.log("Project page updated");
  }

  componentWillUnmount() {
    console.log("Project page will disappear");
  }

  render() {
    return <div className="project-gallery">{this.iterateProjects()}</div>;
  }
}

export default ProjectsPage;
